import { DialogModule } from './dialog.module';
import {
  ApplicationRef,
  ComponentFactoryResolver,
  ComponentRef,
  EmbeddedViewRef,
  Injectable,
  Injector,
  Type,
} from '@angular/core';
import { DialogComponent } from '.';
import { DialogRef, DialogConfig, DialogInjector } from './dialog';

@Injectable({
  providedIn: DialogModule,
})
export class DialogService {
  dialogComponentRef: ComponentRef<DialogComponent>;

  constructor(
    private componentFactoryResolver: ComponentFactoryResolver,
    private appRef: ApplicationRef,
    private injector: Injector
  ) {}

  public open(componentType: Type<any>, config: DialogConfig): DialogRef {
    const dialogRef = this.appendDialogComponentToBody(config);
    this.dialogComponentRef.instance.childComponentType = componentType;
    return dialogRef;
  }

  private appendDialogComponentToBody(config: DialogConfig): DialogRef {
    // Config
    const map = new WeakMap();
    map.set(DialogConfig, config);
    const dialogRef = new DialogRef();
    map.set(DialogRef, dialogRef);
    // After close remove from body
    const sub = dialogRef.afterClosed.subscribe(() => {
      this.removeDialogComponentFromBody();
      sub.unsubscribe();
    });
    // Child component
    const componentFactory =
      this.componentFactoryResolver.resolveComponentFactory(DialogComponent);
    const componentRef = componentFactory.create(
      new DialogInjector(this.injector, map)
    );
    // Inject into body
    this.appRef.attachView(componentRef.hostView);
    const domElem = (componentRef.hostView as EmbeddedViewRef<any>)
      .rootNodes[0] as HTMLElement;
    document.body.appendChild(domElem);
    // Refs
    this.dialogComponentRef = componentRef;
    this.dialogComponentRef.instance.config = config;
    this.dialogComponentRef.instance.onClose.subscribe(() => {
      this.removeDialogComponentFromBody();
    });
    return dialogRef;
  }

  private removeDialogComponentFromBody(): void {
    this.appRef.detachView(this.dialogComponentRef.hostView);
    this.dialogComponentRef.destroy();
  }

  public closeAll(): void {
    this.removeDialogComponentFromBody();
  }
}

import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { APIGetPaged, APIResponse } from '@app/models';
import { Card, Expansion, ResCards } from '@app/pages';
import { BehaviorSubject } from 'rxjs';
import { Cache } from '@app/helpers';
import { LoaderService } from '@app/controls';

@Injectable({
  providedIn: 'root',
})
export class ExpansionService {
  constructor(private http: HttpClient, private loaderService: LoaderService) {}

  // Get expansion
  private getExpansionSubject = new BehaviorSubject<Expansion | null>(null);
  getExpansionObservable() {
    this.getExpansionSubject = new BehaviorSubject<Expansion | null>(null);
    return this.getExpansionSubject.asObservable();
  }
  getExpansion(params: APIGetPaged) {
    if (Cache.expansion[params.code]) {
