            value: userCardGroup.id.toString(),
          })
      ),
    });

    // Notes
    this.buttonNotes = new Button({
      text: 'Notes',
      icon: Icons.stickyNote,
      classes: 'square secondary small-round-left',
      width: '100%',
      click: () => {
        this.dialogService.open(
          UserCardNotesDialogComponent,
          new DialogConfig({
            title: 'Notes',
          })
        );
      },
    });

    // Button remove
    this.buttonRemove = new Button({
      text: 'Remove',
      icon: Icons.trash,
      width: '100%',
      classes: 'secondary square-left',
      click: () => {
        if (confirm('Are you sure you want to delete this item?')) {
          this.deleted.emit(true);
        }
      },
    });
  }
}

import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { Router } from '@angular/router';
import {
  Button,
  ButtonType,
  Select,
  SelectOption,
  Textarea,
  Textbox,
  Toggle,
} from '@app/controls';
import { Icons } from '@app/models';
import { UserCardGroup } from '@app/pages';
import { AuthenticationService } from '@app/pages/auth/auth.service';
import { UserCardGroupService } from './user-card-group.services';

@Component({
  selector: 'user-card-group',
  templateUrl: 'user-card-group.component.html',
  styleUrls: ['./user-card-group.component.scss'],
})
export class UserCardGroupComponent implements OnInit {
  form: FormGroup;
  textboxName: Textbox;
  selectType: Select;
  textareaDescription: Textarea;
  togglePublic: Toggle;
  buttonSave: Button;
  buttonCancel: Button;
  constructor(
    private formBuilder: FormBuilder,
    private authenticationService: AuthenticationService,
    private router: Router,
    private userCardGroupService: UserCardGroupService
  ) {
    if (!this.authenticationService.currentUserValue) {
      this.router.navigateByUrl('/');
    }
  }

  ngOnInit() {
    this.setupSubscriptions();
    this.setupControls();
  }

  setupSubscriptions() {
    this.userCardGroupService
      .addUserCardGroupObservable()
      .subscribe((userCardGroup) => {
        if (userCardGroup) {
          this.router.navigateByUrl('/collection/dashboard');
        }
      });
  }

  setupControls() {
    this.form = this.formBuilder.group({
      nameControl: ['', Validators.required],
      selectType: ['', Validators.required],
      selectIcon: [''],
      descriptionControl: [''],
      publicControl: [''],
    });
    this.textboxName = new Textbox({
      label: 'Name',
    });
    this.selectType = new Select({
      label: 'Type',
      advancedSelect: true,
      multiple: false,
      placeholder: 'Select type...',
      options: [
        new SelectOption({
          text: 'Binder',
          icon: Icons.binder,
          value: 'binder',
        }),
        new SelectOption({
          text: 'Deck',
          icon: Icons.deck,
          value: 'deck',
        }),
        new SelectOption({
          text: 'Trades',
          icon: Icons.exchange,
          value: 'trades',
        }),
        new SelectOption({
          text: 'Box',
          icon: Icons.archive,
          value: 'box',
        }),
        new SelectOption({
          text: 'Group',
          icon: Icons.folder,
          value: 'group',
        }),
      ],
    });
    this.textareaDescription = new Textarea({
      label: 'Description',
    });
    this.togglePublic = new Toggle({
      text: 'Private',
      textChecked: 'Public',
    });
    this.buttonSave = new Button({
      text: 'Save',
      type: ButtonType.submit,
    });
    this.buttonCancel = new Button({
      text: 'Cancel',
      classes: 'secondary',
      route: '/collection/dashboard',
    });
  }

  submit() {
    if (this.form.invalid) {
      return;
    }

    this.userCardGroupService.addUserCardGroup(
      new UserCardGroup({
        name: this.form.controls['nameControl'].value,
        type: this.form.controls['selectType'].value,
        description: this.form.controls['descriptionControl'].value,
        public: this.form.controls['publicControl'].value,
      })
    );
  }
}

